import FA from "react-fontawesome";

const Tips = props => (
  <div>
    <p>Here are a few tips on how to approach these questions</p>

    <ul style={{ paddingTop: "20px" }}>
      <li>
        <FA
          name="radiation"
          style={{ color: "#ff8300", paddingRight: "10px" }}
        />
        Keep your responses simple
      </li>
    </ul>
  </div>
);

export default Tips;
